import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import './styles.css';



function Bikes() {
  return (
    <div class="w3-content">

      <div class="w3-container w3-margin-top" id="cyklar">
        <h2>Cyklar</h2>

        <div class="w3-row-padding w3-padding-16">
          <div class="w3-third w3-margin-bottom">
            <img src="https://images.pexels.com/photos/5792901/pexels-photo-5792901.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=750&w=1260" alt="Barncykel"  />
              <div class="w3-container w3-white">
                <h3>Barncyklar</h3>
                <h6 class="w3-opacity">Från SEK99</h6>
                    <button class="w3-button w3-block w3-black w3-margin-bottom">Välj Cykel</button>
              </div>
          </div>
          </div>
          </div>
          </div>
      
      );
}
    export default Bikes;
